import './App.scss';
import React, {Suspense} from "react";
import Header from "./Components/Header/Header";
import {BrowserRouter} from "react-router-dom";
import {Route, Switch} from "react-router";
import {
    clinicsURLs as clinicsURL,
    employeeURLS,
    invoicesURL,
    patientURLS,
    waitingQueueURLs
} from "./Constants/URLConstants";
import InvoiceInfo from "./Components/Main Content/Invoices/InvoiceInfo";
import Clinic from "./Components/Main Content/Clinics Components/Clinic";
import WaitingQueueMain from "./Components/Main Content/Waiting Queue/WaitingQueueMain";
import WaitingQueueList from "./Components/Main Content/Waiting Queue/WaitingQueueList";
import InvoiceForm from "./Components/Main Content/Invoices/InvoiceForm";


const patient = React.lazy(() => import( './Components/Main Content/Patient/PatientRouter'));
const employee = React.lazy(() => import( './Components/Main Content/Employee/EmployeeRouter'));
const waitingQueue = React.lazy(() => import( './Components/Main Content/Waiting Queue/WaitingQueueRouter'));
const clinics = React.lazy(() => import( './Components/Main Content/Clinics Components/ClinicsRouter'));

function App() {


    return (
        <div className="application">
            <BrowserRouter>
                <Header/>
                <main className="main-content">
                    <Switch>

                        <Suspense fallback={<div> Loading .......</div>}>
                            {/*patient routes*/}
                            <Route path={patientURLS.patient} component={patient}/>

                            {/*employee routes*/}
                            <Route path={employeeURLS.employee} component={employee}/>

                            {/*waiting queue routers*/}
                            <Route  path={waitingQueueURLs.waitingQueue} component={waitingQueue}/>

                            {/*clinics routers*/}
                             <Route exact path={clinicsURL.clinics} component={clinics()}/>
                        </Suspense>


                        {/*invoice routers*/}
                        <Route exact path={invoicesURL.getInvoice + `/:id`} component={InvoiceInfo}/>
                        <Route exact path={invoicesURL.invoiceForm + `/:id`} component={InvoiceForm}/>




                    </Switch>
                </main>

            </BrowserRouter>

        </div>
    );
}

export default App;
